import mongoose from "mongoose";
import answerSchema from "../schemas/answerSchema";

const Answer = mongoose.model("Answer", answerSchema);

export default Answer;

import { Schema } from "mongoose";

const answerSchema = new Schema({
  questionId: String,
  type: {
    type: String,
    required: true,
  },
});

export default answerSchema;

import mongoose from "mongoose";
import { Service } from "typedi";
import { IAnswer } from "../interfaces/common";
import IAnswerRepositoryLayer from "../interfaces/repository/IAnswerRepository";
import Answer from "../models/Answer";
import CustomError from "../errorHandlers/ErrorHandler";
import { STATUS_CODE } from "../utils/constants";

@Service()
export default class AnswerRepository implements IAnswerRepositoryLayer {
  getAnswers = async (): Promise<IAnswer[]> => {
    try {
      return await Answer.find({}, { _id: 0, __v: 0 });
    } catch (error) {
      throw new CustomError(STATUS_CODE.BAD_REQUEST, (error as Error).message);
    }
  };

  postAnswers = async (details: IAnswer): Promise<void> => {
    try {
      await Answer.create({
        questionId: details.questionId,
        type: details.type,
      });
    } catch (error) {
      throw new CustomError(STATUS_CODE.BAD_REQUEST, (error as Error).message);
    }
  };

  putAnswers = async (questionId: string, type: string): Promise<void> => {
    try {
      const currentAnswer = await Answer.findOne({ questionId: questionId });

      if (!currentAnswer) {
        throw new CustomError(STATUS_CODE.NOT_FOUND, "The answer is not found");
      }

      await Answer.findOneAndUpdate({ questionId: questionId }, { type: type });
    } catch (error) {
      throw new CustomError(STATUS_CODE.BAD_REQUEST, (error as Error).message);
    }
  };

  deleteAnswers = async (): Promise<void> => {
    try {
      await Answer.deleteMany({});
    } catch (error) {
      throw new CustomError(STATUS_CODE.BAD_REQUEST, (error as Error).message);
    }
  };
}

import { STATUS_CODE } from "../utils/constants";
class CustomError extends Error {
  public readonly statusCode: STATUS_CODE;

  constructor(statusCode: STATUS_CODE, message: string) {
    super(message);

    Object.setPrototypeOf(this, CustomError.prototype);

    this.statusCode = statusCode;
  }
}

export default CustomError;

import { Service, Container } from "typedi";

import AnswerRepository from "../repositories/AnswerRepository";
import IAnswerService from "../interfaces/services/IAnswerService";
import CustomError from "../errorHandlers/ErrorHandler";
import { IAnswer } from "../interfaces/common";
import { STATUS_CODE } from "../utils/constants";
import { calculateResultHandler } from "../utils/handlers";

@Service()
export default class AnswerService implements IAnswerService {
  private repository = Container.get(AnswerRepository);

  getResults = async (): Promise<string> => {
    try {
      const resultData = await this.repository.getAnswers();

      return calculateResultHandler(resultData);
    } catch (error) {
      throw new CustomError(STATUS_CODE.BAD_REQUEST, (error as Error).message);
    }
  };

  addAnswers = async (details: IAnswer): Promise<void> => {
    try {
      await this.repository.postAnswers({
        questionId: details.questionId,
        type: details.type,
      });
    } catch (error) {
      throw new CustomError(STATUS_CODE.BAD_REQUEST, (error as Error).message);
    }
  };

  updateAnswers = async (questionId: string, type: string): Promise<void> => {
    try {
      await this.repository.putAnswers(questionId, type);
    } catch (error) {
      throw new CustomError(STATUS_CODE.BAD_REQUEST, (error as Error).message);
    }
  };

  deleteAnswers = async (): Promise<void> => {
    try {
      return await this.repository.deleteAnswers();
    } catch (error) {
      throw new CustomError(STATUS_CODE.BAD_REQUEST, (error as Error).message);
    }
  };
}

import { IAnswer } from "../interfaces/common";

export const calculateResultHandler = (answers: IAnswer[]) => {
  const result = answers.reduce((acc, answer: IAnswer) => {
    acc[answer.type] = (acc[answer.type] || 0) + 1;
    return acc;
  }, {} as { [key: string]: number });

  let finalResult: string = "";
  Object.keys(result).forEach((key: string) => {
    if (result[key] === Math.max(result.introvert, result.extrovert)) {
      finalResult = key;
    }
  });

  return finalResult;
};

